First, let's create a dummy smallweb website: mkdir -p ~/www/example
CAT <<EOF > ~/www/example/main.ts
export default { fetch() { return new Response("Smallweb is running", { headers: { "Content-Type": "text/plain", }, }); }
}
EOF If everything went well, you should be able to access https://example.localhost in your browser, and see the message Smallweb is running.

