You can set environment variables for your app by creating a file called .env in the application folder. Here is an example of a .env file: BEARER_TOKEN=SECURE_TOKEN Use the Deno.env.get method to access the environment variables in your app: // File: ~/www/demo/main.ts
export default function (req: Request) { if (req.headers.get("Authorization") !== `Bearer ${Deno.env.get("BEARER_TOKEN")}`) { return new Response("Unauthorized", { status: 401 }); } return new Response(`I'm private!`, { headers: { "Content-Type": "text/plain", }, });
} If you want to set an environment variable for all your apps, you can create a .env file in the ~/www directory.

5.body:
By default, a smallweb app can: read and write the current directory access environment variables using Deno.env.get access the network with fetch If you want to add more permissions to your app (or restrict it even further), you can either: add smallweb.json configuration file at the root of the folder add a smallweb field in your deno.json A json schema for the permissions file is available here . See the deno docs to learn the available permissions . Here is the default config when no smallweb.json file is present: { "$schema": "https://static.pomdtr.me/smallweb.schema.json", "permissions": { "env": true, "net": true, "read": ["."], "write": { "allow": ["."], "deny": [ "smallweb.json", "smallweb.jsonc", "deno.json", "deno.jsonc"] } }
} If you want to add permissions to run a binary, you should start from it, then add the required permissions: { "$schema": "https://static.pomdtr.me/smallweb.schema.json", "permissions": { "run": ["/opt/homebrew/bin/gh"], // add the ability to run the gh binary "env": true, "net": true, "read": ["."], "write": { "allow": ["."], "deny": [ "smallweb.json", "smallweb.jsonc", "deno.json", "deno.jsonc"] } }
} As a general rule, you should only add permissions that are required for your app to run. The more permissions you add, the more attack surface you expose to potential attackers. If you know what you are doing (or just don't care), you can allow all permissions by setting the all field to true. { "$schema": "https://static.pomdtr.me/smallweb.schema.json", "permissions": { "all": true // yolo! }
}

